#include "global.hpp"

typedef pair<long long, long long> pll;
class Solution
{
    int len;
    long mod1, mod2, base1, base2;
    long pow(int a, int m, int mod)
    {
        long ans = 1;
        long contribute = a;
        while (m > 0)
        {
            if (m & 1)
            {
                ans = ans * contribute % mod;
            }
            contribute = contribute * contribute % mod;
            m = m >> 1;
        }
        return ans;
    }
    // long pow(long a, long n, long mod)
    // {
    //     long ret = 1;

    //     if (!n)
    //         return 1;
    //     if (n & 1)
    //     {
    //         return ((pow(a, n / 2, mod) * pow(a, n / 2, mod)) % mod) * a % mod;
    //     }
    //     else
    //     {
    //         return (pow(a, n / 2, mod) * pow(a, n / 2, mod)) % mod;
    //     }
    // }
    int lStringHasDup(vector<int> &s, int l)
    {
        unordered_set<long> usi1, usi2;
        mod1 = 1000000007, mod2 = 1000000009, base1 = 31, base2 = 41;
        set<long> s1, s2;
        long sum1 = 0, sum2 = 0;
        int i;
        long powbase1 = pow(base1, l - 1, mod1);
        long powbase2 = pow(base2, l - 1, mod2);
        for (int i = 0; i < l; ++i)
        {
            sum1 = (sum1 * base1 + (s[i])) % mod1;
            sum2 = (sum2 * base2 + (s[i])) % mod2;
        }
        set<pll> seen;
        // s1.emplace(sum1), s2.emplace(sum2);
        seen.emplace(sum1, sum2);

        for (int i = l; i < len; ++i)
        {
            sum1 = ((sum1 - s[i - l] * powbase1) * base1 + s[i]) % mod1;
            sum2 = ((sum2 - s[i - l] * powbase2) * base2 + s[i]) % mod2;
            sum1 = sum1 < 0 ? sum1 + mod1 : sum1;
            sum2 = sum2 < 0 ? sum2 + mod2 : sum2;
            if (seen.count(make_pair(sum1, sum2)))
            {
                return i - l + 1;
            }
            // if (s1.count(sum1) && s2.count(sum2))
            // {
            //     return i - l + 1;
            // }
            seen.emplace(sum1, sum2);
            // s1.emplace(sum1), s2.emplace(sum2);
        }
        return -1;
    }

public:
    string longestDupSubstring(string s)
    {
        len = s.length();
        int l = 0, r = len, cut = -1;
        int ret = -1;
        vector<int> arr(len);
        for (int i = 0; i < len; ++i)
        {
            arr[i] = s[i] - 'a';
        }
        while (l < r)
        {
            int m = (l + r) / 2;
            if (!m)
                break;
            int loc = lStringHasDup(arr, m);
            if (loc != -1)
            {
                ret = loc;
                cut = m;
                l = m + 1;
            }
            else
            {
                r = m;
            }
        }
        return ret == -1 ? "" : s.substr(ret, cut);
    }
};

